import React from "react";
import Cards from "../../Components/Cards/cards";
import Cardbar from "../../Components/CardBar/cardbar";
import "./main.css";
import { Link } from "react-router-dom";
import Header from "../../Layout/Header/secondaryHeader";
import Filter from "../../Assets/Icons/Filter";

const Main = () => {
  return (
    <div className=" flex ">
      <div className="flex h-[16rem] w-[19rem] items-end justify-center">
        <Filter />
      </div>
      <div className=" mt-8 flex flex-col items-start justify-center gap-6 px-4 ">
        <Header />
        <div className="flex flex-col gap-[5rem] ">
          <div></div>
          <div className="flex flex-col gap-2">
            <Cardbar />
            <Cards />
          </div>
        </div>
        <div className="mx-[2rem] mt-[4.7rem] h-[20rem] w-[30rem] rounded-xl bg-SecondaryWhite"></div>
      </div>
    </div>
  );
};

export default Main;
